import { Skeleton } from '@mui/material';
import React, { useState } from 'react';

const Loading = () => {
	const sliders = [1, 2, 3, 4, 5];
	return (
		<>
			{sliders.map((s) => {
				return (
					<>
						<Skeleton
							style={{
								marginBottom: '20px',
								paddingBottom: '20px',
							}}
						></Skeleton>
						<Skeleton
							style={{
								marginBottom: '20px',
								width: '100%',
								height: '10px',
								borderBottom: '5px solid grey',
							}}
						></Skeleton>
					</>
				);
			})}
		</>
	);
};

export default Loading;
